import AddEmployee from './pages/AddEmployee';
import EmployeeDetails from './pages/EmployeeDetails';
import EmployeeList from './pages/EmployeesList';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import NotFoundPage from './pages/NotFoundPage'
import UpdateEmployee from './pages/UpdateEmployee';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import PrivateRoute from '../src/components/PrivateRoute';
import { AuthProvider } from '../src/hooks/AuthContext';

function App() {
  return (
    <BrowserRouter>
    <AuthProvider>
        <div className="App">
          <div id="page-body">
            <Routes>
              <PrivateRoute path="/employee" element={<EmployeeList />} />
              <PrivateRoute path="/view-employee/:eid" element={<EmployeeDetails />} />
              <PrivateRoute path="/add_employee" element={<AddEmployee />} />
              <PrivateRoute path="/update-employee/:eid" element={<UpdateEmployee />} />
              <Route path="/" element={<LoginPage />} />
              <Route path="/signup" element={<SignupPage />} />
              <Route path="*" element={<NotFoundPage />} />
            </Routes>
          </div>
        </div>
      </AuthProvider>
    </BrowserRouter>
  );
}

export default App;
